import { createSlice, PayloadAction } from "@reduxjs/toolkit";
import { ITodo } from "../interfaces/ITodo";

interface UserState {
  loading: boolean;
  user: ITodo[];
  error: string;
}

const initialState: UserState = {
  loading: false,
  user: [],
  error: "",
};

const todoSlice = createSlice({
  name: "todo",
  initialState,
  reducers: {
	getTodos
  },
});

export const {  } =
todoSlice.actions;
export default todoSlice.reducer;
